from bisect import bisect_left, bisect_right, insort_left

def process_queries(queries):
    S = []
    D = {}
    c = 1
    insert_results = []
    find_results = []
    dump_results = []
    for query in queries:
        if query[0] == 0:
            x = query[1]
            if x not in D:
                insort_left(S, x)
                D[x] = 1
                c += 1
            elif D[x] != 1:
                D[x] = 1
                c += 1
            insert_results.append(c)
        elif query[0] == 1:
            x = query[1]
            if x in D and D[x] == 1:
                find_results.append(1)
            else:
                find_results.append(0)
        elif query[0] == 2:
            x = query[1]
            if x in D and D[x] == 1:
                D[x] = 0
                c -= 1
        elif query[0] == 3:
            L = query[1]
            R = query[2]
            L_index = bisect_left(S, L)
            R_index = bisect_right(S, R)
            dump_output = []
            for j in range(L_index, R_index):
                if D[S[j]] == 1:
                    dump_output.append(S[j])
            dump_results.append(dump_output)
    return (insert_results, find_results, dump_results)

